        contact:
          en: "Rafael Eslava Herrada\nHead of the Licences and Services Unit\nInstituto Federal de Telecomunicaciones\nInsurgentes Sur #838, piso 7\nCol. Del Valle \nDelegación Benito Juárez,\nMÉXICO, D.F. 03100\nMexico\nTel:\t+52 55 5015 4140\nE-mail:\trafael.eslava@ift.org.mx\n\nGerardo López Moctezuma\nDirector General of Authorizations and Services\nInstituto Federal de Telecomunicaciones\nInsurgentes Sur #838, piso 6\nCol. Del Valle \nDelegación Benito Juárez,\nMÉXICO, D.F. 03100\nMéxico\nTel.\t+52 55 5015 4077\nE-mail:\tgerardo.lopez@ift.org.mx\n \nRodolfo Galván Saracho\nDirector of Telecommunication Analysis, Codes and Numbering\nInstituto Federal de Telecomunicaciones\nInsurgentes Sur #838, piso 6\nCol. Del Valle \nDelegación Benito Juárez,\nMÉXICO, D.F. 03100\nMéxico\nTel:\t+52 55 5015 4296\nE-mail:\trodolfo.galvan@ift.org.mx"
        communications:
          - date: 2020-01-18
            contents:
              en:
                type: doc
                content:
                  - type: paragraph
                    content:
                      - type: text
                        text: 'The '
                      - type: text
                        marks:
                          - type: em
                        text: Instituto Federal de Telecomunicaciones
                      - type: text
                        text: >-
                          , México, announces the national numbering plan of
                          Mexico.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          The Basic Technical Numbering Plan issued in 1996 lays
                          the foundation for proper administration and use of
                          national numbering in that it allocates the available
                          resources efficiently, fairly, equitably and in
                          non-discriminatory fashion. Its adoption enabled the
                          country to increase its numeric resources, re-organize
                          existing allocations, harmonize the criteria for
                          allocating long-distance codes and comply with the
                          relevant international recommendations.
                  - type: paragraph
                    content:
                      - type: text
                        text: 'The Numbering Plan defines '
                      - type: text
                        marks:
                          - type: em
                        text: inter alia
                      - type: text
                        text: ' the structure of geographic and non-geographic numbers, special service codes, prefixes giving access to the long-distance service and the dialling procedures to be used for calling from within the national territory.'
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          In order to adapt the existing subscriber numbering to
                          that format, the length of the subscriber number
                          (Recommendation ITU-T E.164) was increased to seven
                          digits throughout the country, except in the cities of
                          Mexico, Guadalajara and Monterrey, where it was
                          increased to eight digits.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Starting on 17 November 2001 at 0800 hours UTC, the
                          numbering structure in Mexico for geographic numbers
                          was configured in such a way that the national number
                          increased from eight to ten digits and consisted of
                          the national destination code (area code) and the
                          subscriber number, as set out below.
                  - type: paragraph
                    content:
                      - type: text
                        marks:
                          - type: strong
                        text: Structure of geographic numbers
                  - type: paragraph
                    content:
                      - type: text
                        marks:
                          - type: strong
                        text: Structure of the subscriber number
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Subscriber numbers will comprise seven or eight digits
                          and will be structured as follows:
                  - type: paragraph
                    content:
                      - type: text
                        text: Subscriber number (7 or 8 digits)
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_"
                  - type: table
                    content:
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: Exchange series
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: Exchange internal number
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: c d1 e f
                                  - type: hard_break
                                  - type: text
                                    text: d e f
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: g h i j
                                  - type: hard_break
                                  - type: text
                                    text: g h i j
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_"
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Where: c, d <> 0, and d1, e, f, g, h, i, j = 0, 1,
                          2,…, 9
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_"
                  - type: bullet_list
                    content:
                      - type: list_item
                        content:
                          - type: paragraph
                            content:
                              - type: text
                                text: >-
                                  The eight-digit structure is applied to local
                                  high-density networks, such as those in the
                                  metropolitan areas of Mexico City, Guadalajara
                                  and Monterrey. The seven-digit structure
                                  applies in the rest of the country.
                  - type: bullet_list
                    content:
                      - type: list_item
                        content:
                          - type: paragraph
                            content:
                              - type: text
                                text: >-
                                  The digit zero (0) may not be used as the
                                  first digit of an exchange series number.
                  - type: bullet_list
                    content:
                      - type: list_item
                        content:
                          - type: paragraph
                            content:
                              - type: text
                                text: >-
                                  Within a group of exchanges in the fixed or
                                  mobile service, all numbers must have the same
                                  quantity of digits.
                  - type: paragraph
                    content:
                      - type: text
                        marks:
                          - type: strong
                        text: Structure of the national number
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          The national number has a fixed length of ten digits
                          and is structured as follows:
                  - type: paragraph
                    content:
                      - type: text
                        text: National number (10 digits)
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_"
                  - type: table
                    content:
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
