                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: National destination code (NDC)
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: Subscriber number
                      - type: table_row
                        content:
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: A B
                                  - type: hard_break
                                  - type: text
                                    text: A B C
                          - type: table_cell
                            attrs:
                              colspan: 1
                              rowspan: 1
                              colwidth: null
                            content:
                              - type: paragraph
                                content:
                                  - type: text
                                    text: c d1 e f g h i j
                                  - type: hard_break
                                  - type: text
                                    text: d2 e f g h i j
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_"
                  - type: paragraph
                    content:
                      - type: text
                        text: "Where: A, c y\_ d2 <> 0 and B, C, d1, e, f, g, h, i, j = 0, 1, …, 9"
                  - type: paragraph
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          The Local Service Rules were issued on 22 October 1997
                          in order to ensure efficient interconnection and
                          interoperability of the public telecommunication
                          networks authorized to provide local service. Rule 26
                          refers to the “calling party pays” dialling scheme.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Under the “calling party pays” scheme, the user
                          originating the public switched call dials the prefix
                          "044" before dialling the corresponding national
                          number.
                  - type: paragraph
                    content:
                      - type: text
                        text: 044 + NDC + subscriber number (7 or 8 digits)
                  - type: paragraph
                    content:
                      - type: text
                        text: 'On 18 February 2003, the '
                      - type: text
                        marks:
                          - type: em
                        text: Diario Oficial de la Federación
                      - type: text
                        text: ' published the resolution authorizing mobile service licence-holders to offer their users an optional ten-digit dialling procedure for calls to subscriber numbers, local calls to destinations in the “calling party pays” mode, and national long-distance calls. In those cases, the following dialling procedures are used:'
                  - type: paragraph
